import React from 'react';


const resultHeader = ({ location, isCustom, toggleCustomForm, toggleUi }) => {
  return (
    <div>
      <h3>Searching for eating options in {location}</h3>
      <h2>{isCustom ? 'Custom ' : 'Random '} Results Page</h2>
      <button onClick={() => toggleUi('landing')}>MAIN PAGE</button>

      {
        isCustom && <button onClick={() => toggleCustomForm()}>EDIT SEARCH CRITERIA</button>
      }

    </div>
  );
};

export default resultHeader;
